import Login from "./Login";
import { Route, Routes } from 'react-router-dom'


function Controller() {
    return (       <div className='container'>
    <Routes>
      {/* home component  */}
      <Route path='/' element={<Login/>} />
    </Routes>
  </div> );
}

export default Controller;
